(67, 'Ngọa Long Mobile lập kỷ lục về số lượng tướng', 'Với mong muốn tái hiện lại thời Tam Quốc một cách chân thật nhất, nhà sản xuất đã đưa toàn bộ những nhân vật có ảnh hưởng lớn đến thời kỳ này vào Ngọa Long Mobile (NLM). Tham gia game, bạn sẽ bắt gặp những danh tướng nổi tiếng như: Chu Du, Tào Tháo, Lưu Bị và Gia Cát Lượng,...\r\n\r\nHệ thống võ tướng trong NLM được chia thành nhiều hệ phái khác nhau như quân sư, cấm quân, thống lĩnh,… Mỗi vị tướng lại có năng lực riêng và phù hợp với những loại trận pháp và binh chủng khác nhau. Đặc biệt, các vị tướng “xịn” chỉ xuất hiện thông qua tính năng hội đàm mang tính ngẫu nhiên.\r\n\r\n\r\n \r\nTheo các con số được NPH VNG công bố thì số lượng võ tướng trong NLM là 1135 tướng, được phân chia theo màu sắc. Có 3 cách để chiêu mộ võ tướng là vượt phó bản, chiêu mộ bằng uy danh quốc gia và thông qua hội đàm tại tửu quán. Các võ tướng xuất hiện trong tửu quán thông qua tính năng hội đàm thường là những võ tướng tinh anh và có khả năng xuất chúng.\r\n \r\n\r\n \r\nMỗi một vị tướng lại có năng lực riêng và phù hợp với các loại trận pháp và binh chủng khác nhau. Mặc dù số lượng võ tướng có những kỹ năng giống nhau cũng không phải là ít nhưng với 1135 tướng, thì kho kỹ năng của NLM cũng là một con số đáng kể. Đặc biệt, tướng còn có thể sở hữu kỹ năng mới khi được nâng cấp.', '<p>Với mong muốn tái hiện lại thời Tam Quốc một cách chân thật nhất, nhà sản xuất đã đưa toàn bộ những nhân vật có ảnh hưởng lớn đến thời kỳ này vào Ngọa Long Mobile (NLM). Tham gia game, bạn sẽ bắt gặp những danh tướng nổi tiếng như: Chu Du, Tào Tháo, Lưu Bị và Gia Cát Lượng,...</p>\n\n<p>Hệ thống võ tướng trong NLM được chia thành nhiều hệ phái khác nhau như quân sư, cấm quân, thống lĩnh,… Mỗi vị tướng lại có năng lực riêng và phù hợp với những loại trận pháp và binh chủng khác nhau. Đặc biệt, các vị tướng “xịn” chỉ xuất hiện thông qua tính năng hội đàm mang tính ngẫu nhiên.</p>\n\n<p>Theo các con số được NPH VNG công bố thì số lượng võ tướng trong NLM là 1135 tướng, được phân chia theo màu sắc. Có 3 cách để chiêu mộ võ tướng là vượt phó bản, chiêu mộ bằng uy danh quốc gia và thông qua hội đàm tại tửu quán. Các võ tướng xuất hiện trong tửu quán thông qua tính năng hội đàm thường là những võ tướng tinh anh và có khả năng xuất chúng.</p>\n\n<p>Mỗi một vị tướng lại có năng lực riêng và phù hợp với các loại trận pháp và binh chủng khác nhau. Mặc dù số lượng võ tướng có những kỹ năng giống nhau cũng không phải là ít nhưng với 1135 tướng, thì kho kỹ năng của NLM cũng là một con số đáng kể. Đặc biệt, tướng còn có thể sở hữu kỹ năng mới khi được nâng cấp.</p>\n', '', 1, '2013-10-25 02:08:26', '2013-10-25 02:08:31', 24, 8, 'ngọa-long-mobile-lập-kỷ-lục-về-số-lượng-tướng', 1, '2013-10-25 02:08:31', 0, 1, 0, 1),
(68, 'Sale off event', 'Sale off package has appeared! Be fast and seize the packages to triumph over your enemies! Do not miss it, it will be available for only 3 days!\r\n\r\nTime: 2013-10-25 00:00 till 2013-10-27 23:59\r\n    Apply to: Server 1 - Hero\r\n    Content During event, an epic package will appear in the sale off shop!\r\n    It contains: 50,000 coin, 5,000 honor, Growth guard scroll 1, Blessing *1, Green star gem700\r\n    Original price: 1280 Gold\r\n    Limited price: 688 Gold\r\n\r\nNote\r\n\r\ni. Each player can only buy 5 sale off packages per day\r\nii. When event ends, the package will disappear\r\niii.The sale off shop is available only to players at level 70 or above', '<p>Sale off package has appeared! Be fast and seize the packages to triumph over your enemies! Do not miss it, it will be available for only 3 days!</p>\n\n<p>Time: 2013-10-25 00:00 till 2013-10-27 23:59\n    Apply to: Server 1 - Hero\n    Content During event, an epic package will appear in the sale off shop!\n    It contains: 50,000 coin, 5,000 honor, Growth guard scroll 1, Blessing *1, Green star gem700\n    Original price: 1280 Gold\n    Limited price: 688 Gold</p>\n\n<p>Note</p>\n\n<p>i. Each player can only buy 5 sale off packages per day\nii. When event ends, the package will disappear\niii.The sale off shop is available only to players at level 70 or above</p>\n', '', 1, '2013-10-25 02:14:21', '2013-10-25 02:14:24', 25, 8, 'sale-off-event', 1, '2013-10-25 02:14:24', 1, 0, 0, 1),
