(72, 'What''s New', '***Version 2.3:  \r\n- All campaigns closely follow the story of Water Margin  \r\n- Hundreds of heroes to recruit  \r\n- Adventurers and challengers will be amazed by "Nightmare" difficulty!  \r\n- Thousands of treasures and items waiting you to explore and craft!  \r\n- Includes unique systems: VIP, Guild, Gem, Group buy, Titles, Recruit, Inn, Slave    \r\n- Special features: Guild War, Faction War, World BOSS, Maze, Tattoo, Zodiac, Stars', '<p>***Version 2.3:<br />\n- All campaigns closely follow the story of Water Margin<br />\n- Hundreds of heroes to recruit<br />\n- Adventurers and challengers will be amazed by "Nightmare" difficulty!<br />\n- Thousands of treasures and items waiting you to explore and craft!<br />\n- Includes unique systems: VIP, Guild, Gem, Group buy, Titles, Recruit, Inn, Slave<br />\n- Special features: Guild War, Faction War, World BOSS, Maze, Tattoo, Zodiac, Stars</p>\n', '', 1, '2013-10-28 12:37:01', '2013-10-28 12:37:32', 1, NULL, 'what-is-new', 1, '2013-10-28 12:37:14', 0, 0, 0, 1),
(73, '20h30 tối nay trao giải Nhân tài Đất Việt 2013', 'Giải thưởng Khoa học lớn và uy tín hàng đầu đất nước\r\n \r\nBước sang năm thứ 9, Giải thưởng Nhân tài Đất Việt 2013 (NTĐV) đã khẳng định vị thế vững chắc trong xã hội, thực sự là nơi tôn vinh nhân tài. Giải thưởng luôn nhận được sự quan tâm sâu sắc của lãnh đạo Đảng, Nhà nước, giới khoa học và các tầng lớp xã hội.', '<p>Giải thưởng Khoa học lớn và uy tín hàng đầu đất nước</p>\n\n<p>Bước sang năm thứ 9, Giải thưởng Nhân tài Đất Việt 2013 (NTĐV) đã khẳng định vị thế vững chắc trong xã hội, thực sự là nơi tôn vinh nhân tài. Giải thưởng luôn nhận được sự quan tâm sâu sắc của lãnh đạo Đảng, Nhà nước, giới khoa học và các tầng lớp xã hội.</p>\n', '', 1, '2013-11-20 11:51:16', '2013-11-20 11:53:01', 5, 1, '20h30-tối-nay-trao-giải-nhân-tài-đất-việt-2013', 1, '2013-11-20 11:51:22', 0, 1, 0, 1),
