(1, 'Tình kiếm demo', 'app1', '', 'Tình và kiếm , nói chung là không hiểu lắm.\r\n\r\nNội dung trong game là cuộc chiến giữa kiếm và tình.\r\n#####<span style=''color:red''>Các tính năng trong game: </span>\r\n\r\n - **Đấu trường**: Nơi khẳng định sức mạnh.\r\n - **Kết  hôn**: Nơi kết hôn.\r\n - **Nuôi vịt**: để bán lấy tiền.\r\n - **Săn muỗi**: để tránh bị đốt.\r\n\r\nMicrosoft đã chính thức vén bức màn bí mật về thế hệ thiết bị chơi game mới nhất của họ mang tên Xbox One, so với thế hệ Xbox 360 trước đó thì tất nhiên cấu hình của Xbox One cao hơn rất nhiều và đối thủ cạnh tranh trực tiếp với máy không ai khác đó chính là PlayStation 4 của Sony. Cả hai đều có chip xử lý 8 nhân cùng với 8 GB RAM, có đầu đọc đĩa Blu-ray và cổng USB 3.0.', '<p>Tình và kiếm , nói chung là không hiểu lắm.</p>\n\n<p>Nội dung trong game là cuộc chiến giữa kiếm và tình.</p>\n\n<h5><span style=''color:red''>Các tính năng trong game: </span></h5>\n\n<ul>\n<li><strong>Đấu trường</strong>: Nơi khẳng định sức mạnh.</li>\n<li><strong>Kết  hôn</strong>: Nơi kết hôn.</li>\n<li><strong>Nuôi vịt</strong>: để bán lấy tiền.</li>\n<li><strong>Săn muỗi</strong>: để tránh bị đốt.</li>\n</ul>\n\n<p>Microsoft đã chính thức vén bức màn bí mật về thế hệ thiết bị chơi game mới nhất của họ mang tên Xbox One, so với thế hệ Xbox 360 trước đó thì tất nhiên cấu hình của Xbox One cao hơn rất nhiều và đối thủ cạnh tranh trực tiếp với máy không ai khác đó chính là PlayStation 4 của Sony. Cả hai đều có chip xử lý 8 nhân cùng với 8 GB RAM, có đầu đọc đĩa Blu-ray và cổng USB 3.0.</p>\n', NULL, NULL, '2013-05-02', 302, 'tinhkiem', '2013-05-02 00:44:44', '2014-06-25 12:30:16', '0.1', 'support@mobgame.vn', '109336685751749', '> iOS 4.3', 'itms-apps://itunes.apple.com/vn/app/tinh-kiem/id597768531?mt=8&uo=4', 'itms-services://?action=download-manifest&url=http://dungbx.com/mobgame/MobGameDemo.plist', 'UA-41972645-3', '', 'Dashboard', '1', '1', 'http://forum.soha.vn', 'eng', 1, '', '', '', 1, '', '', ''),
